        lang_fr_FR:"https://raw.githack.com/Thathanka-Iyothanka/TWToolkit/master/Languages/fr_FR.js",
        lang_en_US:"https://raw.githack.com/Thathanka-Iyothanka/TWToolkit/master/Languages/en_US.js",
        lang_de_DE:"https://raw.githack.com/Thathanka-Iyothanka/TWToolkit/master/Languages/de_DE.js", //Thanks to Tom Robert
        lang_pt_PT:"https://raw.githack.com/Thathanka-Iyothanka/TWToolkit/master/Languages/pt_PT.js", //Thanks to LoMexicano and capitao.cesar
        lang_pt_BR:"https://raw.githack.com/Thathanka-Iyothanka/TWToolkit/master/Languages/pt_PT.js", //Thanks to LoMexicano and capitao.cesar
        lang_pl_PL:"https://raw.githack.com/Thathanka-Iyothanka/TWToolkit/master/Languages/pl_PL.js", // Thanks to Wojcieszy
        lang_it_IT:"https://raw.githack.com/Thathanka-Iyothanka/TWToolkit/master/Languages/it_IT.js", // Thanks to Huyana
        lang_es_ES:"https://raw.githack.com/Thathanka-Iyothanka/TWToolkit/master/Languages/es_ES.js", // Thanks to pepe100
        lang_hu_HU:"https://raw.githack.com/Thathanka-Iyothanka/TWToolkit/master/Languages/hu_HU.js", // Thanks to Ördögh Vilmos
